@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain("galaxy.com.pk"){
*{
   font-family:Calibri,"Lucida Grande",Tahoma,Arial,sans-serif !important;
}
td[bgcolor="#2f4f68"], td[bgcolor="#2f4f68"] span,
td[bgcolor="#419dfa"], td[bgcolor="#055aab"],
table[background="logo/Galaxyback.gif"] tr:hover>td:not([bgcolor="#2f4f68"]),
td[style*="border-right: 1px solid rgb(6, 90, 172); border-bottom: 1px solid rgb(6, 90, 172);"] a[href]:hover{
/* theme color */
   background-color:#0C7895 !important;
}
td[bgcolor="#2f4f68"], td[bgcolor="#2f4f68"] span{
   border-color:#0C7895 !important;
}
table#table2 td:hover font{
   color:#0C7895 !important;
}

html>body>p[style*="margin-top: -22px;"], marquee,
img[src="image/PLCS.png"], img[src="image/computer2.jpg"], 
img[src="image/computer2.jpg"]+br,
img[src="image/computer2.jpg"]+br+font+br{
   display:none !important;
   height:0 !important;
}
table[width="765"]{ border-color:#fff !important }
td[width^="7"]{ border-style:none !important }

td[style*="border-style: solid; border-width: 1px; padding-left: 4px; padding-right: 4px;"],
td[style*="border-right-style: solid; border-right-width: 1px; border-bottom-style: solid; border-bottom-width: 1px;"],
td[style*="border-left-style: solid; border-left-width: 1px; border-bottom-style: solid; border-bottom-width: 1px"],
td[style*="border-left: 1px solid rgb(192, 192, 192); border-bottom: 1px solid rgb(192, 192, 192); padding-left: 4px; padding-right: 4px;"],
td[style*="border-left: 1px solid rgb(192, 192, 192); border-right: 1px solid rgb(192, 192, 192); border-bottom: 1px solid rgb(192, 192, 192);"],
td[style*="border-bottom: 1px solid rgb(192, 192, 192); padding-left: 4px; padding-right: 4px; border-right-style: solid; border-right-width: 1px;"],
td[style*="border-left: 1px solid; width: 108px; height: 11.5pt; padding-left: 4px; padding-right: 4px; border-bottom-style: solid; border-bottom-width: 1px;"],
td[style*="border-style: none solid solid; border-width: medium 1pt 1pt; border-top: medium none; border-left: 1pt solid; padding: 0in 5pt;"],
td[style*="padding-left: 4px; padding-right: 4px; border-left-style: solid; border-left-width: 1px; width: 96px; border-bottom-style: solid; border-bottom-width: 1px;"],
td[style*="padding-right: 4px; border-bottom-style: solid; border-bottom-width: 1px;"],
td[style*="border-left: 1px solid; padding-left: 4px;"],
td[style*="border-left: 1px solid rgb(192, 192, 192); border-bottom: 1px solid rgb(192, 192, 192); width: 109px; padding-left: 4px; padding-right: 4px;"]{
   border: 1px solid #F1F1F1 !important; 
   padding-left: 4px; padding-right: 4px;
}
font[size="1"]{
   font-size:11px !important;
}
font[color="#ffff00"]{
   font:bold 14px/14px Calibri,"Lucida Grande",Tahoma,Arial,sans-serif !important;
   color:#fff !important;
   letter-spacing:-1px !important;
}
td[bgcolor="#055aab"], td[bgcolor="#2f4f68"], td[bgcolor="#2f4f68"] span{
   -moz-border-radius-topleft:8px !important;
   -moz-border-radius-topright:8px !important;
}
td[bgcolor="#2f4f68"], td[bgcolor="#2f4f68"] span{
   -moz-opacity:0.8 !important;
}
td[bgcolor="#419dfa"]{
   -moz-opacity:0.6 !important;
   text-indent:6px !important;
   border-color:#EDEDED !important;
}
img[src$="galaxyword.gif"], img[src$="image/header.jpg"]{ /* logo */
   width:0 !important;
   height:0 !important;
   padding: 46px 0 0 296px !important;
   background-image:url('data:image/gif;base64,') !important;
}
table#table3 td[valign="bottom"]{
   vertical-align:top !important;
}
table#table1 table#table2[background]{
   background-image:none !important;
}
table[background="logo/Galaxyback.gif"]{
   background-image:none !important;
}
table[background="logo/Galaxyback.gif"] td{
   height:19px !important;
}
table[background="logo/Galaxyback.gif"] td a{
   text-decoration:none !important;
}
table[background="logo/Galaxyback.gif"] td a:hover{
   text-decoration:underline !important;
}
table[background="logo/Galaxyback.gif"] tr:hover>td:not([bgcolor="#2f4f68"]){
   -moz-opacity:0.9 !important;
   background-color:#D8E7EE !important; /* row rollover color */
}
table[background="logo/Galaxyback.gif"] tr:hover>td[rowspan],
table[background="logo/Galaxyback.gif"] tr:hover>td[rowspan]+td+td,
table[background="logo/Galaxyback.gif"] tr:hover>td[width^="75"]{
   background-color:#fff !important;
   -moz-opacity:1 !important;
}
}

@-moz-document url("http://galaxy.com.pk/"),url("http://www.galaxy.com.pk/"),
url-prefix("http://www.galaxy.com.pk/index.htm"),
url-prefix("http://galaxy.com.pk/index.htm"){
html{
   background:url(data:image/gif;base64,R0lGODlhFAAUAIAAACQkJB0dHSwAAAAAFAAUAAACKoyPoMvowSJ4RjZarcJ6Y9hx4ddNVPmBmriSIxulqCvJ72nZLXzxMR0pAAA7) left top repeat !important;
}
body{
   position:absolute;
   top: 50%;
   left: 50%;
   width:776px !important;
   height:440px !important;
   padding:0 12px 8px 12px !important;
   margin-left:-400px !important;
   margin-top:-224px !important;
   background-color:#fff !important;
   overflow:hidden !important;
   border:0 #fff solid !important;
   -moz-border-radius:12px !important;
   -moz-opacity:0.6 !important;
}
body:hover{ -moz-opacity:0.9 !important; }

html>body>p[style*="margin-top: -22px;"], marquee,
embed, a[href^="gaming"], img[src="image/PLCS.png"],
div#layer102, div#layer140, div#layer139, div#layer73, div#layer124,
div#layer15, div#layer12, div#layer125, div#layer83, div#layer127, div#layer136, 
div#layer136+p, div#layer136+p+p{
   display:none !important;
   height:0 !important;
}
div[id*="layer"]{
   position:static !important;
}

div#layer13{
   position:static !important;
   margin-top:-25px !important;
}
div#layer14 p img{
   display:none !important;
}
div#layer14{ /* header */
   position:static !important;
   display:block !important;
   width:775px !important;
   background:#fff url('data:image/gif;base64,R0lGODlhAwADAJEAAP39/f///39/f/7+/iH5BAAAAAAALAAAAAADAAMAAAIF1AYnEQUAOw==') top left repeat-x !important;
}

div#layer16{
   position:static !important;
   width:auto !important;
   height:auto !important;
   border-style: none !important;
}
div#layer16>*{
   display:none !important;
}
div#layer16 div#layer141{
   display:block !important;
}
div#layer16 div#layer142{
   display:block !important;
}


/* update date div */
div#layer71{
   width:150px !important;
   background-color: transparent !important;
   border-style: none !important;
   margin-left:auto !important;
   padding-right:10px !important;
}
div#layer71 p{
   text-align:right !important;
}
div#layer71 p font{
   font:normal 10px/12px Calibri,"Lucida Grande",Tahoma,Arial,sans-serif !important;
   color:#aaa !important;
}

/* main link back strip */
div#layer78{
   width:100% !important;
   height:100px !important;
   margin-top:-160px !important;
   border-top: 1px #F2F2F2 solid !important;
   border-bottom: 1px #E3E3E3 solid !important;
   border-left-style:none !important;
   border-right-style:none !important;
   background-color: #F8F8F8 !important;
}
div#layer78 img{
   width:0 !important;
   height:0 !important;
   margin:-48px 0 0 40px !important;
   padding: 198px 0 0 178px !important;
   background:transparent url('data:image/png;base64,') left top no-repeat !important;
}

/* main link div */
div#layer67, div#layer68, div#layer69, div#layer70{
   position:static !important;
   margin-top:-100px !important;
   margin-left:0px !important;
   z-index:99 !important;
}
div#layer67{ margin-left:210px !important; }
div#layer68{ margin-left:280px !important; }
div#layer69{ margin-left:350px !important; }
div#layer70{ margin-left:420px !important; }
div#layer141{
   position:relative !important;
   margin-left:480px !important;
   z-index:98 !important;
   top:-41px !important;
}
div#layer142{
   position:absolute!important;
   margin-left:-45px !important;
   z-index:99 !important;
   margin-top:35px !important;
}
a[href$="aboutus.htm"],
a[href$="disti.htm"],
a[href$="support.htm"],
a[href$="contact.htm"],
a[href$="price.htm"],
a[href$="order.htm"]
{/* main links */
   display:block !important;
   width:60px !important;
   height:70px !important;
   background:#fff url('data:image/gif;base64,') 0 0 no-repeat !important;
   text-indent:-9999px !important;
   outline-style:none !important;
}
a[href$="aboutus.htm"]{ background-position:0 0 !important;}
a[href$="aboutus.htm"]:hover{ background-position:0 -70px !important;}
a[href$="disti.htm"]{ background-position: -60px 0 !important;}
a[href$="disti.htm"]:hover{ background-position:-60px -70px !important;}
a[href$="support.htm"]{ background-position:-120px 0 !important;}
a[href$="support.htm"]:hover{ background-position:-120px -70px  !important;}
a[href$="contact.htm"]{ background-position:-180px 0 !important;}
a[href$="contact.htm"]:hover{ background-position:-180px -70px !important;}
a[href$="price.htm"]{ background-position:-240px 0 !important;}
a[href$="price.htm"]:hover{ background-position:-240px -70px !important;}
a[href$="order.htm"]{ background-position:-300px 0 !important;}
a[href$="order.htm"]:hover{ background-position:-300px -70px !important;}

div#layer104{ /* footer */
   position:relative !important;
   border:none !important;
   width:775px !important;
   line-height:20px !important;
   padding:0 !important;
   top:400px !important;
   background:#fff url('data:image/gif;base64,R0lGODlhAwADAJEAAP39/f///39/f/7+/iH5BAAAAAAALAAAAAADAAMAAAIF1AYnEQUAOw==') top left repeat-x !important;
}
div#layer104>p>b{ padding-top:2px !important;}
div#layer104>p>b :after{
   content:" CSS modified by Shirazi";
   font:bold 10px/11px Calibri,"Lucida Grande",Tahoma,Arial,sans-serif !important;

}
div[style^="position: absolute; width: 151px;"]{
   background-color:transparent !important;
   position:static !important;
   width:70px !important;
   height:70px !important;
   float:left !important;
}

}
@-moz-document url-prefix("http://www.galaxy.com.pk/price.htm"),
url-prefix("http://galaxy.com.pk/price.htm"){

body{
   width:100% !important;
   margin:0 auto !important;
   background-color:#fff !important;
}
iframe[height="809"]{
   margin-top:-10px !important;
   margin-left:-10px !important;
   height:1000px !important;
}

/* header */
table#table1 td[height="75"], table#table1[height="75"]{
   height:50px !important;
   margin-top:-15px !important;
}
table#table1 td p img[src="image/header.jpg"]{
   position:relative;
   left:-610px !important;
}

/* top horizon navi */
table#table2{
   background-color:transparent !important;
}
table#table2 td{
   border-style:none !important;
   height:10px !important;
}
table#table2 td font{
   color:#fff !important;
}
table#table2 td a{
   display:block !important;
   width:100% !important;
   line-height:17px !important;
   color:#fff !important;
   -moz-border-radius:7px;
   /*background-color:#008BB2 !important;*/
}
table#table2 td font a:hover{
   background-color:#fff !important;
   /*-moz-opacity:0.9 !important;*/
   color:#000 !important;
}
table#table2>tbody>tr+tr :first-child+td{
   -moz-border-radius-topleft:8px;
   -moz-border-radius-bottomleft:8px;
}
table#table2>tbody>tr+tr :first-child+td+td+td+td+td+td{
   -moz-border-radius-topright:8px;
   -moz-border-radius-bottomright:8px;
   /*background-color:#f00 !important;*/
   -moz-opacity:0.5 !important;
}
table#table2>tbody>tr+tr :first-child+td+td+td+td+td+td font{
   color:#fff !important;
}

/* left vertical navig */
td[style*="border-right: 1px solid rgb(6, 90, 172); border-bottom: 1px solid rgb(6, 90, 172);"]{
   border-left: 1px solid #EDEDED !important; 
   border-right: 1px solid #EDEDED !important; 
   border-bottom: 1px solid #EDEDED !important;
   padding:0 !important;
}
td[style*="border-right: 1px solid rgb(6, 90, 172); border-bottom: 1px solid rgb(6, 90, 172);"] p{
   margin:0 !important;
}
td[style*="border-right: 1px solid rgb(6, 90, 172); border-bottom: 1px solid rgb(6, 90, 172);"] a font{
   color:#000 !important;
}
td[style*="border-right: 1px solid rgb(6, 90, 172); border-bottom: 1px solid rgb(6, 90, 172);"] a[href]{
   display:block !important;
   line-height:18px !important;
   padding-left:5px !important;
   text-decoration:none !important;
}
td[style*="border-right: 1px solid rgb(6, 90, 172); border-bottom: 1px solid rgb(6, 90, 172);"] a[href]:hover{
   -moz-opacity:1 !important;
}
td[style*="border-right: 1px solid rgb(6, 90, 172); border-bottom: 1px solid rgb(6, 90, 172);"] a[href]:hover font{
   color:#fff !important;
   padding-left:2px !important;
   font-size:12px !important;
}
}

@-moz-document url-prefix("http://www.galaxy.com.pk/offer2.htm"),
url-prefix("http://galaxy.com.pk/offer2.htm"),
url-prefix("http://www.galaxy.com.pk/offer2.htm"){
table#table3 td{
   border-style:none !important;
}
table#table3>tbody>tr:first-child>td{
   height:40px !important;
   border:1px #fff solid !important;
}
table#table3>tbody>tr>:first-child{
   border:1px #fff solid !important;
   display:none !important;
}
}
